      <text id="9" justification="0" size="4" underlined="false">
        <text>23)
Scrivere una programma java per rappresentare dei giocatori di baseball. Per ciascun giocatore devono essere rappresentati il nome come stringa, un punteggio che rappresenta la bravura del giocatore in battuta e la sua età. Si devono quindi realizzare i seguenti metodi:
• Giocatore(String nome, int eta) costruttore con due argomenti.
• Giocatore(String nome, int eta, double valore) costruttore con tre argomenti.
• String getNome() che ritorna il nome del giocatore.
• double getPunteggio() che ritorna il punteggio del giocatore.
• void setPunteggio(double nuovoPunteggio) che pone il punteggio del giocatore a nuovoPunteggio.
• int getEta() che ritorna l&apos;età del giocatore
• int setEta() che modifica l&apos;età del giocatore
• String toString() che visualizza tutti i dati del giocatore
Fai un menu in cui sia possibile inserire un nuovo giocatore, visualizzare i suoi dati.</text>
